import { Dimensions } from "react-native";

export default {
  cardContainer: {
    flex: 1,
  },

  headerContainer: {
    alignItems: "center",
    backgroundColor: "#FFF",
    marginBottom: 50,
    marginTop: 70,
  },
  indicatorTab: {
    backgroundColor: "transparent",
  },
  scroll: {
    backgroundColor: "#FFF",
  },
  sceneContainer: {
    marginTop: 10,
  },
  socialIcon: {
    marginLeft: 14,
    marginRight: 14,
  },

  socialRow: {
    flexDirection: "row",
  },
  tabBar: {
    backgroundColor: "#EEE",
  },
  masonryContainer: {
    flexDirection: "row",
    flexWrap: "wrap",
    justifyContent: "space-between",
    marginLeft: 0,
    marginRight: 0,
  },
  tabContainer: {
    flex: 1,
    marginBottom: 12,
  },
  tabLabelNumber: {
    color: "gray",
    fontSize: 12.5,
    textAlign: "center",
  },
  tabLabelText: {
    color: "black",
    fontSize: 22.5,
    fontWeight: "600",
    textAlign: "center",
  },
  userBioRow: {
    marginLeft: 2,
    marginRight: 40,
  },
  userBioText: {
    color: "gray",
    fontSize: 10,
  },
  userImage: {
    height: 300,
    marginBottom: 10,
    width: 200,
  },
  userNameRow: {
    marginBottom: 2,
  },
  changephoto: {
    marginBottom: 2,
  },
  changeText: {
    color: "#2196f3",
    fontSize: 14,
    fontWeight: "bold",
    textAlign: "center",
  },

  item1: {
    width: "35%",
    marginLeft: 10,
  },
  save: {
    alignItems: "center",
    marginTop: 30,
  },
  item2: {
    width: "45%",
    alignItems: "center",
    marginRight: 10,
  },
  userNameText: {
    color: "#5B5A5A",
    fontSize: 14,
    fontWeight: "bold",
    textAlign: "center",
  },
  userRow: {
    alignItems: "center",
    flexDirection: "column",
    justifyContent: "center",
    marginBottom: 12,
  },
  container: {
    marginLeft: 10,
    marginTop: 20,
    alignItems: "center",
    flex: 1,
    flexDirection: "row",
    flexWrap: "wrap",
  },
  //for login and signup inputs
  TextInput: {
    height: 40,
    width: 240,
    borderColor: "grey",
    marginRight: 30,
    borderBottomWidth: 1,
    marginBottom: 20,
    margin: 10,
  },
  TextBioInput: {
    height: 60,
    width: 240,
    borderColor: "grey",
    marginRight: 30,
    borderBottomWidth: 1,
    marginBottom: 20,
    margin: 10,
  },
  //for login and signup title
  titleText: {
    fontSize: 30,
    fontWeight: "bold",
  },
};
